getTemplate_uiControl14_TQBUKw: |-
  export default class extends React.Component{
    constructor(props){
      super(props);
    }
    agreeNext=()=>{
      var handler=this.props.customHandler;
      if(handler){
        handler({
          eventType:"agreeNext"
        })
      }
    }
    render() {
      var data=this.props.customData;
      return (
        <div className='registration-protocol-btn'>
          <button onClick={this.agreeNext}>{data}</button>
        </div>
      )
    }
  }
